import Link from 'next/link'
import {ile} from "./OperatorTileStyled";

const OperatorTile = ({ ...props }) => {

    return(
        <Tile as={`/pay/${props.operatorName}`} href={`/pay/[payOperatorID]`}>
            <div>
                <h2>{props.operatorName}</h2>
                <img src="" alt="Лого оператора"/>
            </div>
        </Tile>
    )
}

export default OperatorTile
